defs.script:
  let apmaster = 0,
    bank = 0,
    calculatedValue,
    hdgtext = 0,
    config = {},
    currentalt = 0,
    ap = 0,
    hdg = 0,
    obsValue = 0;
    aphdglockdir = 0,
    aphdglock = 0
window.parent.addEventListener("update", eventHandler, true);

function setSelectedValueBoxContent(label, value){
   d3.select('#selected-value-box').text(label);
   d3.select('#ap-hdg-selected-value').text(value);
   d3.select('#ap-hdg-selected-box').style('display', 'block');
   closeHdgLockDirBox = setTimeout(function(){
      d3.select('#ap-hdg-selected-box').style('display','none');
   }, 3000);
}

function eventHandler(update) {
   Update(update.detail);
}

  var path = window.parent.location.pathname.split('/');
  path.pop();
  path = path.join("/") + "/";
  fetchAsync(window.parent.location.pathname + '/config.json')
    .then(data => {
      config = data[window.frameElement.id];
      return true;
    })
    .catch(reason => console.log("Error in config.json:\n" + reason))

  function init(){
    //calculatedValue = config.calculatedValue ? config.calculatedValue : 0;
  }

  function Update(inputObject){
    for(let attr = 0; attr < Object.keys(inputObject).length; attr++){
      let key = Object.keys(inputObject)[attr];
      let value = Object.values(inputObject)[attr] ;
      value = (/^\d.*\.*\d$/.test(calculatedValue) ? eval(calculatedValue.replace("x",value)) : value);

      switch (key.toUpperCase()) {
        case 'GPS_GROUND_SPEED':
          d3.select('#gs-value').text(Math.round(value));
          break;

        case 'PLANE_HEADING_DEGREES_MAGNETIC':
            value === 0 ? 360 : value;
            hdg = value % 360;
            hdgtext = Math.abs(Math.floor(value % 360));
            if (value < 0) {
               hdgtext = 360 - Math.abs(Math.floor(hdgtext));
            }
            d3.select('#compass-rose').attr('transform', 'rotate(' + value * -1 +', 516.98242, 422)');
            d3.select('#cdi-set').attr('transform', 'rotate(' + ( hdg * 1 - obsValue * 1  ) *-1 +', 516.98242, 422)');
            d3.select('#hdg-value').text(hdgtext);
            break;

         case 'AUTOPILOT_HEADING_LOCK_DIR':
            if (value !== aphdglockdir) {
               //clearTimeout(closeHdgLockDirBox);
               aphdglockdir = Math.floor(value);
               setSelectedValueBoxContent('Selected Heading',aphdglockdir + '°');

            }
            break;

        case 'AUTOPILOT_HEADING_LOCK':
          aphdglock = value;
          if (value && aphdglockdir && apmaster) {
            d3.select('#ap-selected-hdg-bug').style('display','block');
            d3.select('#ap-hdg-active-sign').style('display','block');
            d3.select('#hdg-lock-indicator').style('display','block');
          } else {
            d3.select('#ap-selected-hdg-bug').style('display','none');
            d3.select('#ap-hdg-active-sign').style('display','none');
            d3.select('#hdg-lock-indicator').style('display','none');
          }
          break;

        case 'NAV_1_OBS':
            if (value !== obsValue) {
               obsValue = Math.floor(value);
               clearTimeout(closeHdgLockDirBox);
               d3.select('#cdi-set').attr('transform', 'rotate(' + ( hdg * 1 - obsValue * 1  ) *-1 +', 516.98242, 422)');
               setSelectedValueBoxContent('Selected CRS',obsValue + '°');
            }
            break;
          break;

        case 'NAV_1_CDI':
          d3.select('#cdi').attr('transform', 'translate('+value * 1.07 +', 0)');
          break;

        case 'NAV_1_GSI':
          d3.select('#gsi').attr('transform', 'translate(0, '+value * 0.96+')');
          break;

        default:
          //console.log('       :-(    Attribute '+key+' not relevant for this element... Ignoring');
      };
    }
  }
